import{_ as t,o as n,c as i,z as e,a as s}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 3.2-3220 Virginia Milk Commission Assessments Fund established.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-3220.md","filePath":"vacode/3.2-3220.md"}'),a={name:"vacode/3.2-3220.md"},r=e("h1",{id:"§-3-2-3220-virginia-milk-commission-assessments-fund-established",tabindex:"-1"},[s("§ 3.2-3220 Virginia Milk Commission Assessments Fund established. "),e("a",{class:"header-anchor",href:"#§-3-2-3220-virginia-milk-commission-assessments-fund-established","aria-label":'Permalink to "§ 3.2-3220 Virginia Milk Commission Assessments Fund established."'},"​")],-1),o=e("p",null,'There is hereby created in the state treasury a special nonreverting fund to be known as the Virginia Milk Commission Assessments Fund, hereafter referred to as "the Fund." The Fund shall be established on the books of the Comptroller. All receipts from assessments paid under this chapter shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be used solely for the purposes of administering this chapter. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon written request signed by the Administrator or his duly authorized agent.',-1),d=e("p",null,[s("Code 1950, § 3-374; 1966, c. 702, § 3.1-453; 2008, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860",target:"_blank",rel:"noreferrer"},"860"),s(".")],-1),l=[r,o,d];function h(m,c,u,p,f,b){return n(),i("div",null,l)}const y=t(a,[["render",h]]);export{g as __pageData,y as default};
